import React from "react";
import "./style.css";
import {
  AiGithub,
  AiTwitter,
  AiFacebookF,
  AiLinkedin,
  AiYoutube,
  AiTwitch,
  AiInstagram,
  AiSnapchatGhost,
  AiTiktok,
  AiCircle
} from "react-icons/ai";
import { socialprofils } from "../../content_option";

const ICON_MAPPING = {
  default: AiCircle,
  facebook: AiFacebookF,
  github: AiGithub,
  instagram: AiInstagram,
  linkedin: AiLinkedin,
  snapchat: AiSnapchatGhost,
  tiktok: AiTiktok,
  twitter: AiTwitter,
  twitch: AiTwitch,
  youtube: AiYoutube
};

export const Socialicons = (params) => {
  return (
    <div className="stick_follow_icon">
      <ul>
        {Object.entries(socialprofils).map(([platform, url]) => {
          const IconComponent = ICON_MAPPING[platform] || ICON_MAPPING.deAiult;
          return (
            <li key={platform}>
              <a href={url}>
                <IconComponent />
              </a>
            </li>
          );
        })}
      </ul>
      <p>Follow Me</p>
    </div>
  );
};
